/*Table structure for table `coupons` */

DROP TABLE IF EXISTS `coupons`;

CREATE TABLE `coupons` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `percentage` tinyint(1) DEFAULT '0',
  `once` tinyint(1) DEFAULT '1',
  `max_count` int(10) DEFAULT '1',
  `free_delivery` tinyint(1) DEFAULT '0',
  `not_for_sale` tinyint(1) DEFAULT '0',
  `only_rbk` tinyint(1) DEFAULT '0',
  `code` varchar(30) DEFAULT NULL,
  `value` decimal(10,2) DEFAULT '0.00',
  `issue_date` date DEFAULT NULL,
  `term_date` date DEFAULT NULL,
  `created` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `used` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

