/*Table structure for table `gallery` */

DROP TABLE IF EXISTS `gallery`;

CREATE TABLE `gallery` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `page_id` int(11) unsigned NOT NULL,
  `active` tinyint(1) DEFAULT '1',
  `sort` int(3) DEFAULT NULL,
  `slug` varchar(250) DEFAULT NULL,
  `heading` tinyint(1) DEFAULT '0',
  `pagination` tinyint(1) DEFAULT '1',
  `created` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `deleted` tinyint(1) DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `gallery` */

/*Table structure for table `newsletter_users` */

DROP TABLE IF EXISTS `newsletter_users`;

CREATE TABLE `newsletter_users` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `newsletter_id` int(11) unsigned NOT NULL,
  `user_id` int(11) unsigned NOT NULL,
  `email` varchar(250) NOT NULL,
  `sent` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `newsletter_users_newsletter_id_fkey` (`newsletter_id`),
  KEY `newsletter_users_user_id_fkey` (`user_id`),
  CONSTRAINT `newsletter_users_newsletter_id_fkey` FOREIGN KEY (`newsletter_id`) REFERENCES `newsletters` (`id`),
  CONSTRAINT `newsletter_users_user_id_fkey` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `newsletter_users` */

/*Table structure for table `newsletters` */

DROP TABLE IF EXISTS `newsletters`;

CREATE TABLE `newsletters` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `subject` varchar(250) NOT NULL,
  `message` text NOT NULL,
  `sent` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `created` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `newsletters` */

/*Table structure for table `notifyings` */

DROP TABLE IF EXISTS `notifyings`;

CREATE TABLE `notifyings` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `product_id` int(11) unsigned NOT NULL,
  `product_node_id` int(11) unsigned NOT NULL,
  `email` varchar(250) NOT NULL,
  `sent` timestamp NULL DEFAULT NULL,
  `created` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `notifyings_product_id_fkey` (`product_id`),
  KEY `notifyings_product_node_id_fkey` (`product_node_id`),
  CONSTRAINT `notifyings_product_id_fkey` FOREIGN KEY (`product_id`) REFERENCES `products` (`id`),
  CONSTRAINT `notifyings_product_node_id_fkey` FOREIGN KEY (`product_node_id`) REFERENCES `product_nodes` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `notifyings` */

/*Table structure for table `order_details` */

DROP TABLE IF EXISTS `order_details`;

CREATE TABLE `order_details` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `order_id` int(11) unsigned NOT NULL,
  `shipping_date_day` int(2) DEFAULT NULL,
  `shipping_date_month` int(2) DEFAULT NULL,
  `shipping_date_year` int(4) DEFAULT NULL,
  `shipping_time` int(2) DEFAULT NULL,
  `exact_interval_from_h` int(2) DEFAULT NULL,
  `exact_interval_from_m` int(2) DEFAULT NULL,
  `exact_interval_till_h` int(2) DEFAULT NULL,
  `exact_interval_till_m` int(2) DEFAULT NULL,
  `shipping_city` int(2) DEFAULT NULL,
  `shipping_place_type` int(2) DEFAULT NULL,
  `full_address` text,
  `clarify_everything` tinyint(1) DEFAULT '0',
  `clarify_address_fr` tinyint(1) DEFAULT '0',
  `a_name` varchar(30) DEFAULT NULL,
  `a_surname` varchar(30) DEFAULT NULL,
  `a_phone` varchar(20) DEFAULT NULL,
  `b_name` varchar(30) DEFAULT NULL,
  `b_surname` varchar(30) DEFAULT NULL,
  `b_phone` varchar(20) DEFAULT NULL,
  `b_email` varchar(128) DEFAULT NULL,
  `created` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `order_details_order_id_fkey` (`order_id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;

