  `comment` text,
  `ip` varchar(15) DEFAULT NULL,
  `sent` tinyint(1) DEFAULT '0',
  `rbk_payment_id` varchar(32) DEFAULT NULL,
  `created` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `orders_user_id_fkey` (`user_id`),
  KEY `orders_cart_id_fkey` (`cart_id`),
  KEY `orders_coupon_id_fkey` (`coupon_id`),
  CONSTRAINT `orders_cart_id_fkey` FOREIGN KEY (`cart_id`) REFERENCES `cart` (`id`),
  CONSTRAINT `orders_coupon_id_fkey` FOREIGN KEY (`coupon_id`) REFERENCES `coupons` (`id`),
  CONSTRAINT `orders_user_id_fkey` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`)
