/*Table structure for table `points` */

DROP TABLE IF EXISTS `points`;

CREATE TABLE `points` (
  `id` varchar(10) NOT NULL,
  `country_id` int(11) unsigned DEFAULT NULL,
  `region_id` int(11) unsigned DEFAULT NULL,
  `district_id` int(11) unsigned DEFAULT NULL,
  `active` tinyint(4) DEFAULT '0',
  `title` varchar(250) DEFAULT NULL,
  `latin` varchar(250) DEFAULT NULL,
  `full_title` text,
  PRIMARY KEY (`id`),
  KEY `points_country_id_fkey` (`country_id`),
  KEY `points_region_id_fkey` (`region_id`),
  KEY `points_district_id_fkey` (`district_id`),
  CONSTRAINT `points_country_id_fkey` FOREIGN KEY (`country_id`) REFERENCES `countries` (`id`),
  CONSTRAINT `points_district_id_fkey` FOREIGN KEY (`district_id`) REFERENCES `districts` (`id`),
  CONSTRAINT `points_region_id_fkey` FOREIGN KEY (`region_id`) REFERENCES `regions` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

