/*Table structure for table `wishlist` */

DROP TABLE IF EXISTS `wishlist`;

CREATE TABLE `wishlist` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(11) unsigned NOT NULL,
  `key` varchar(32) NOT NULL,
  `title` varchar(250) DEFAULT NULL,
  `email` varchar(250) DEFAULT NULL,
  `created` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `wishlist_user_id_fkey` (`user_id`),
  CONSTRAINT `wishlist_user_id_fkey` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `wishlist` */

/*Table structure for table `wishlist_items` */

DROP TABLE IF EXISTS `wishlist_items`;

CREATE TABLE `wishlist_items` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `wishlist_id` int(11) unsigned NOT NULL,
  `product_id` int(11) unsigned NOT NULL,
  `product_node_id` int(11) unsigned NOT NULL,
  `quantity` int(3) DEFAULT '1',
  `created` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `wishlist_items_wishlist_id_fkey` (`wishlist_id`),
  KEY `wishlist_items_product_id_fkey` (`product_id`),
  KEY `wishlist_items_product_node_id_fkey` (`product_node_id`),
  CONSTRAINT `wishlist_items_product_id_fkey` FOREIGN KEY (`product_id`) REFERENCES `products` (`id`),
  CONSTRAINT `wishlist_items_product_node_id_fkey` FOREIGN KEY (`product_node_id`) REFERENCES `product_nodes` (`id`),
  CONSTRAINT `wishlist_items_wishlist_id_fkey` FOREIGN KEY (`wishlist_id`) REFERENCES `wishlist` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

